import React from 'react'
import {Link} from 'react-router-dom'

function TopMenu () {

    return (
        <div>
            {
                localStorage.getItem('auth') !== '' ?
                    (
                        <div className = 'nav nav-tab'>
                            <Link to ='#' > Home </Link>
                         </div>
                    )
                : (
                    <div>  Hello</div>
                )

                 
            }
        </div>
    )
}

export default TopMenu
